EventTarget.!doc:
Mixins event emitter functionality to a class

function MyEmitter() {}

PIXI.EventTarget.mixin(MyEmitter.prototype);

var em = new MyEmitter();
em.emit('eventName', 'some data', 'some more data', {}, null, ...);

